import React from 'react';
import logo from '../../images/himachal_pradesh_climate.gif';

function HimachalPradeshClimate() {
  //   let logo = require('/images/india_Climate.gif');

  return (
    <div style={{ height: '100%' }}>
      <img
        src={logo}
        alt='Himachal Pradesh Climate'
        style={{ width: '100%', height: '100%' }}
      />
    </div>
  );
}

export default HimachalPradeshClimate;
